    class stlsLCGRandom extends stlsRandom {
        static #seedUniquifier = Long.fromString("8682522807148012");
        static #multiplier = Long.fromString("25214903917");
        static #addend = Long.fromNumber(11);
        static #mask = Long.fromNumber(1).shl(48).sub(1);
        static #FLOAT_UNIT = 1 / Long.fromNumber(1).shl(53).toNumber();

        static #getSeedUniquifier() {
            stlsLCGRandom.#seedUniquifier = stlsLCGRandom.#seedUniquifier.mul(Long.fromString("1181783497276652981"));
            return stlsLCGRandom.#seedUniquifier;
        }

        static #initialScramble(seed) {
            return Long.fromNumber(seed).xor(stlsLCGRandom.#multiplier).and(stlsLCGRandom.#mask);
        }

        constructor(seed) {
            super();
            if (seed === undefined)
                seed = stlsLCGRandom.#getSeedUniquifier().xor(performance.now() * 1e6);
            this.setSeed(seed)
        }

        setSeed(seed) {
            if (!Number.isInteger(seed)) {
                console.warn(i18n("stlsBetterRandom.console.seedMustBeInteger") + seed);
                return;
            }
            this.seed = stlsLCGRandom.#initialScramble(seed);
        }

        #next(bits) {
            // 复制seed，防止修改原始的seed值。
            const oldSeed = Long.fromValue(this.seed);
            this.seed = oldSeed.mul(stlsLCGRandom.#multiplier).add(stlsLCGRandom.#addend).and(stlsLCGRandom.#mask);
            return Long.fromValue(this.seed).shru(48 - bits).toNumber();
        }

        nextInt(min, max) {
            if (max === undefined) {
                return min === undefined ? this.#nextInt0() : this.#nextInt1(min);
            }
            return this.#nextInt2(min, max);
        }

        #nextInt0() {
            return this.#next(32);
        }

        #nextInt1(max) {
            if (!Number.isInteger(max) || max <= 0)
                return i18n(`stlsBetterRandom.warnings.intBound`);

            let r = this.#next(31);
            let m = max - 1;
            if ((max & m) === 0)
                r = Long.fromNumber(r).mul(max).shr(31).toNumber();
            else {
                for (let u = r;
                    u - (r = u % max) + m < 0;
                    u = this.#next(31))
                    ;
            }
            return r;
        }

        #nextInt2(min, max) {
            if (!Number.isInteger(min) || !Number.isInteger(max) || min >= max)
                return i18n(`stlsBetterRandom.warnings.intRange`);

            let r = this.#nextInt0();
            const n = max - min;
            const m = n - 1;
            if ((n & m) === 0) {
                r = (r & m) + min;
            } else {
                let u;
                do {
                    r = this.#nextInt0();
                    u = r >>> 1;
                    r = u % n;
                } while (u + m - r < 0);
                r += min;
            }
            return r;
        }

        nextFloat(min, max) {
            if (max === undefined) {
                return min === undefined ? this.#nextFloat0() : this.#nextFloat1(min);
            }
            return this.#nextFloat2(min, max);
        }

        #nextFloat0() {
            return Long.fromNumber(this.#next(26)).shl(27).add(this.#next(27)).toNumber() * stlsLCGRandom.#FLOAT_UNIT;
        }

        #nextFloat1(max) {
            if (!(0 < max && max < Number.POSITIVE_INFINITY))
                return i18n(`stlsBetterRandom.warnings.floatBound`);

            let r = this.#nextFloat0() * max;
            return r >= max ? nextDown(max) : r;
        }

        #nextFloat2(min, max) {
            if (!(Number.NEGATIVE_INFINITY < min && min < max && max < Number.POSITIVE_INFINITY))
                return i18n(`stlsBetterRandom.warnings.floatRange`);

            const range = max - min;
            let r = this.#nextFloat0() * range + min;
            return r >= max ? nextDown(max) : r;
        }

        nextBoolean() {
            return this.#next(1) !== 1;
        }
    }
    class stlsMersenneTwisterRandom extends stlsRandom {
        static #N = 624;
        static #M = 397;
        static #MATRIX_A = 0x9908b0df;
        static #UPPER_MASK = 0x80000000;
        static #LOWER_MASK = 0x7fffffff;

        constructor(seed) {
            super();
            this.mt = new Array(stlsMersenneTwisterRandom.#N);
            this.index = stlsMersenneTwisterRandom.#N + 1;
            this.setSeed(seed || Date.now());
        }

        setSeed(seed) {
            if (!Number.isInteger(seed)) {
                console.warn(i18n("stlsBetterRandom.console.seedMustBeInteger") + seed);
                return;
            }
            this.mt[0] = (seed || Date.now()) >>> 0;
            for (this.index = 1; this.index < stlsMersenneTwisterRandom.#N; this.index++) {
                const s = this.mt[this.index - 1] ^ (this.mt[this.index - 1] >>> 30);
                this.mt[this.index] = (((((s & 0xffff0000) >>> 16) * 1812433253) << 16) + (s & 0x0000ffff) * 1812433253) + this.index;
                this.mt[this.index] >>>= 0;
            }
        }

        #twist() {
            for (let i = 0; i < stlsMersenneTwisterRandom.#N; i++) {
                const x = (this.mt[i] & stlsMersenneTwisterRandom.#UPPER_MASK) + (this.mt[(i + 1) % stlsMersenneTwisterRandom.#N] & stlsMersenneTwisterRandom.#LOWER_MASK);
                let xA = x >>> 1;
                if (x % 2 !== 0) {
                    xA ^= stlsMersenneTwisterRandom.#MATRIX_A;
                }
                this.mt[i] = this.mt[(i + stlsMersenneTwisterRandom.#M) % stlsMersenneTwisterRandom.#N] ^ xA;
            }
            this.index = 0;
        }

        #next() {
            if (this.index >= stlsMersenneTwisterRandom.#N) {
                this.#twist();
            }

            let y = this.mt[this.index++];
            y ^= (y >>> 11);
            y ^= ((y << 7) & 0x9d2c5680);
            y ^= ((y << 15) & 0xefc60000);
            y ^= (y >>> 18);

            return y >>> 0;
        }
        nextInt(min, max) {
            if (max === undefined) {
                if (min === undefined) {
                    return this.#next(); // 如果没有传入任何参数，返回一个随机整数
                }
                // 注意: 此处的min代表max
                if (!Number.isInteger(min) || min <= 0)
                    return i18n(`stlsBetterRandom.warnings.intBound`);
                return this.#next() % min; // 返回 [0, max) 范围内的整数
            }
            if (!Number.isInteger(min) || !Number.isInteger(max) || min >= max)
                return i18n(`stlsBetterRandom.warnings.intRange`);
            return min + (this.#next() % (max - min)); // 返回 [min, max) 范围内的整数
        }

        nextFloat(min, max) {
            if (max === undefined) {
                if (min === undefined) {
                    return this.#next() * (1.0 / 4294967296.0); // 默认返回 [0, 1) 范围内的浮点数
                }
                // 注意: 此处的min代表max
                if (!(0 < min && min < Number.POSITIVE_INFINITY))
                    return i18n(`stlsBetterRandom.warnings.floatBound`);
                return this.#next() * (1.0 / 4294967296.0) * min; // 返回 [0, max) 范围内的浮点数
            }
            if (!(Number.NEGATIVE_INFINITY < min && min < max && max < Number.POSITIVE_INFINITY))
                return i18n(`stlsBetterRandom.warnings.floatRange`);
            return min + (this.#next() * (1.0 / 4294967296.0) * (max - min)); // 返回 [min, max) 范围内的浮点数
        }

        nextBoolean() {
            return this.#next() % 2 === 0;
        }
    }
    class stlsXorshiftRandom extends stlsRandom {
        constructor(seed) {
            super();
            // 初始化种子
            this.setSeed(seed || Date.now() % 2147483647); // 使用当前时间作为种子
        }
        // 设置种子的方法
        setSeed(seed) {
            if (!Number.isInteger(seed)) {
                console.warn(i18n("stlsBetterRandom.console.seedMustBeInteger") + seed);
                return;
            }
            this.seed = seed;
        }

        // Xorshift 算法
        #next() {
            this.seed ^= (this.seed << 13);
            this.seed ^= (this.seed >>> 17);
            this.seed ^= (this.seed << 5);
            return this.seed >>> 0; // 返回无符号整数
        }

        nextInt(min, max) {
            if (min === undefined && max === undefined) {
                return this.#next(); // 如果没有参数，返回随机整数
            }
            // 如果max未传入, 则返回[0, min)的随机整数
            if (max === undefined) {
                if (!Number.isInteger(min) || min <= 0)
                    return i18n(`stlsBetterRandom.warnings.intBound`);
                return this.#next() % min; // 处理负值情况
            }
            // 返回[min, max) 的随机整数，确保返回值在正确范围内
            if (!Number.isInteger(min) || !Number.isInteger(max) || min >= max)
                return i18n(`stlsBetterRandom.warnings.intRange`);
            const range = max - min;
            return min + this.#next() % range;
        }

        nextFloat(min, max) {
            // 生成一个范围在 [0, 1) 之间的随机浮点数
            const randomFloat = this.#next() / 0xFFFFFFFF;
            if (max === undefined) {
                if (min === undefined) { // max和min都缺省，返回[0, 1)的随机浮点数
                    return randomFloat;
                }
                // 只传入min，将min当做最大值，返回[0, min)的随机浮点数
                if (!(0 < min && min < Number.POSITIVE_INFINITY))
                    return i18n(`stlsBetterRandom.warnings.floatBound`);
                return min * randomFloat;
            }
            // 根据 min 和 max 调整范围
            if (!(Number.NEGATIVE_INFINITY < min && min < max && max < Number.POSITIVE_INFINITY))
                return i18n(`stlsBetterRandom.warnings.floatRange`);
            return min + randomFloat * (max - min);
        }

        nextBoolean() {
            return (this.#next() & 1) === 0; // 返回随机布尔值
        }
    }

